      <h3> {title}</h3>
      <p>{characters.map(({ name }) => `${name}, `)}</p>
      <style jsx>{`
        div {
          padding: 4px 20px;
          border: solid 1px rgba(20, 20, 20, 0.1);
        }
      `}</style>
    </div>
  );
};

export default FilmItem;
